  Texas COVID-19 Vaccine Tracker





  The reach of COVID-19 on Texas and the world has been devastating. As our state joins a global effort to put coronavirus into our past, we are tracking the Texas vaccine roll-out as it unfolds in real-time.
  Texas has 24,068,624 people aged 12 and older who are currently eligible for the vaccine. As of Sep 01, 2021, the state has:


   | Fully Vaccinated: 13,809,684 people or 57% of the population 12+  | Vaccinated w/ At Least One Dose: 16,531,113 people or 69% of the population 12+  | Administered: 21,219 doses in one day on Sep 01, 2021 or 0.09% of the population 12+  | A 7-Day Average of 64,597 administered per day or 0.27% of the population 12+



